    "description-groupe": "Cat\u00e9gorisation des logiciels telle qu'elle est pr\u00e9sent\u00e9e en annexe B du document \u00ab\u00a0LOGICIELS LIBRES ET OUVERTS Guide d'analyse de maturit\u00e9\u00a0\u00bb (aussi connu sous le nom de \u00ab\u00a0Portefeuille de logiciels libres et ouverts (POLLO)\u00a0\u00bb ISBN 978-2-550-67218-0 (en ligne) \u00a9 Gouvernement du Qu\u00e9bec - 2013.", 
