    "nom-groupe": "APELL", 
    "description-groupe": "La typologie des logiciels telle que pr\u00e9sent\u00e9e sur le site de l'APPELL (l'Association Professionnelle des Entreprises en Logiciels Libres) \u00e0 l'adresse\nhttp://www.apell-quebec.ca/content/ressources?quicktabs_1=2#quicktabs-1", 
    "id-groupe": "APELL"
}

{
    "nom-groupe": "Facilit\u00e9 de gestion des logiciels", 
    "description-groupe": "Cette cat\u00e9gorisation des logiciels les regroupes en trois classes selon la facilit\u00e9 avec laquelle on peut les g\u00e9rer en organisation. Le positionnement dans une classe se fait suivant les trois crit\u00e8res suivants\u00a0: est-ce que les donn\u00e9es sont verrouill\u00e9es\u00a0? la p\u00e9rennit\u00e9 du code est-elle assur\u00e9e\u00a0? y a-t-il une adh\u00e9rence sur d'autres logiciels\u00a0?", 
    "id-groupe": "Facilit\u00e9 de gestion des logiciels"
}

